import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation item to be visible
    await page.waitForSelector('.nav-item[data-page="history"]');

    // Click on the History navigation item
    await page.click('.nav-item[data-page="history"]');

    // Wait for the history page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the history page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_history_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_history_page.png'));

    return {
      success: true,
      action: "Clicked on the History navigation menu item to view watch history.",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

